import React from 'react'
import { Link } from 'react-router-dom'
import { Container } from '../../Styled'

function LandingPage() {
  return (
    <Container>
        <h2>Landing Page </h2>

        <Link to='/adminlogin'>Login</Link> 
        <Link to='/createuser'>Sign Up</Link> 

    </Container>
  )
}

export default LandingPage
